public class Solution {
    public String[][] solve(String[][] board) {
        if (board == null || board.length == 0 || board[0].length == 0) return board;
        int m = board.length, n = board[0].length;
        boolean hasO = false;
        for (int i = 0; i < m; ++i) {
            if (board[i][0] == "O") {
                dfs(board, i, 0);
                hasO = true;
            }
            if (board[i][n - 1] == "O") {
                dfs(board, i, n - 1);
                hasO = true;
            }
        }
        for (int j = 0; j < n; ++j) {
            if (board[0][j] == "O") {
                dfs(board, 0, j);
                hasO = true;
            }
            if (board[m - 1][j] == "O") {
                dfs(board, m - 1, j);
                hasO = true;
            }
        }
        if (!hasO) return new String[][]{};
        for (int i = 0; i < m; ++i) {
            for (int j = 0; j < n; ++j) {
                if (board[i][j] == "#") continue;
                if (i > 0 && board[i-1][j]!= "#" && board[i-1][j] == "O") board[i][j] = "O";
                else board[i][j] = "X";
            }
        }
        return board;
    }

    private void dfs(String[][] board, int x, int y) {
        if (x < 0 || x >= board.length || y < 0 || y >= board[0].length || board[x][y]!= "O") return;
        board[x][y] = "#";
        dfs(board, x + 1, y);
        dfs(board, x - 1, y);
        dfs(board, x, y + 1);
        dfs(board, x, y - 1);
    }
}
